import React from 'react';
import {BrowserRouter, Switch, Route} from 'react-router-dom';
import Home from './Components/Home'
import Contact from './'

export default class App extends React.Component{
  render() {
    return(
      <BrowserRouter>
        <Switch>
          <Route exact path='/' Component={Home}></Route>
        </Switch>
      </BrowserRouter>
    );
  }
}
